import React from "react";
import ReactDOM from "react-dom";
import "./index.css";
import App from "./App";
import * as serviceWorker from "./serviceWorker";

function MyInfo() {
  <div>
    <h1>Ronak Gune</h1>
    <p>I am a recent graduate from SCU and am looking for new opportunities.</p>
    <ol>
      <li>Mallorca</li>
      <li>Cannes</li>
      <li>Bali</li>
    </ol>
  </div>;
}

serviceWorker.unregister();
